import React,{useState, useEffect} from 'react'

import { Button, Form, FormGroup, Label, Input } from 'reactstrap'

export default function PaisAgregar() {
    const url='http://127.0.0.1:3001/rol';
    const initPais={
        PAIS_CODIGO:'',
        PAIS_NOMBRE:'',
        ROL_DESCRIPCION:'',
        
    }
    const [pais, setPais]= useState(initPais);
    const[paises,setPaises] = useState([]);
    const [cargado,setCargado] = useState(false);
    
    const traerDatos=async()=>{
      let datos = await fetch(url).then(resp=>resp.json());
      console.log('traerDatos::',datos);
      setPaises(datos);
      setCargado(!datos.length>0);
    }
    useEffect(()=>{
      traerDatos();
    },[]);
    
    const cambiarValor=(e)=>{
      const {name,value}=e.target;
      setPais({...pais,
      [name]:value});
    
     
    
    }
  return (
    <Form>
    <div className="card-header">
        <h3>Paises</h3>
    </div>
    <div className="card-body">
        
        <FormGroup>
            <Label for="codigo">Codigo del Pais</Label>
            <Input 
            type="text" 
            name="codigo" 
            id="codigo" 
            placeholder="Digite el codigo del pais" />
        </FormGroup>
        <FormGroup>
            <Label for="nombre">Nombre de Pais</Label>
            <Input 
            type="text" 
            name="nombre" 
            id="nombre" 
            placeholder="Digite el nombre " />
        </FormGroup>
        <FormGroup>
            <Label for="valor"> Bandera del Pais </Label>
            <p></p>
            <Button 
            name="img" 
            variant=""
            id="img" 
            >Inserte la imagen</Button>
        
        </FormGroup>
        <Button className='btn btn-success'>Agregar</Button>
        
        <Button className='btn btn-secondary' >Limpiar</Button>
        <Button variant="primary" href="/menuSeguridad/pais">Regresar</Button>
       
    </div></Form>
  )
}
